-- Sélection de la base de données "zarca_bdd"
USE zarca_bdd;

-- Création de la table "animal"
CREATE TABLE IF NOT EXISTS animal (
    animal_id INT AUTO_INCREMENT PRIMARY KEY,
    date_nour DATE,
    etat VARCHAR(255),
    habitat_id INT,
    heure_nour TIME,
    image_id INT,
    nour VARCHAR(255),
    prenom VARCHAR(255),
    qte_nour INT,
    race_id INT,
    rapport_veterinaire_id INT,
    FOREIGN KEY (race_id) REFERENCES race(race_id),
    FOREIGN KEY (rapport_veterinaire_id) REFERENCES rapport_veterinaire(rapport_veterinaire_id)
);

-- Création de la table "avis"
CREATE TABLE IF NOT EXISTS avis (
    avis_id INT AUTO_INCREMENT PRIMARY KEY,
    commentaire VARCHAR(1000),
    isVisible TINYINT,
    pseudo VARCHAR(255)
);

-- Création de la table "habitat"
CREATE TABLE IF NOT EXISTS habitat (
    habitat_id INT AUTO_INCREMENT PRIMARY KEY,
    commentaire_habitat VARCHAR(1000),
    description VARCHAR(1000),
    image_id INT,
    nom VARCHAR(255)
);

-- Création de la table "image"
CREATE TABLE IF NOT EXISTS image (
    image_id INT AUTO_INCREMENT PRIMARY KEY,
    image_data MEDIUMBLOB,
    image_type VARCHAR(255)
);

-- Création de la table "race"
CREATE TABLE IF NOT EXISTS race (
    race_id INT AUTO_INCREMENT PRIMARY KEY,
    label VARCHAR(255)
);

-- Création de la table "rapport_veterinaire"
CREATE TABLE IF NOT EXISTS rapport_veterinaire (
    rapport_veterinaire_id INT AUTO_INCREMENT PRIMARY KEY,
    date DATE,
    detail VARCHAR(1000)
);

-- Création de la table "role"
CREATE TABLE IF NOT EXISTS role (
    role_id INT AUTO_INCREMENT PRIMARY KEY,
    label VARCHAR(255)
);

-- Création de la table "horaire"
CREATE TABLE horaire (
    id INT AUTO_INCREMENT PRIMARY KEY,
    debut TIME NOT NULL,
    fin TIME NOT NULL
);

-- Création de la table "service"
CREATE TABLE IF NOT EXISTS service (
    service_id INT AUTO_INCREMENT PRIMARY KEY,
    description VARCHAR(1000),
    image_id INT,
    nom VARCHAR(255)
);

-- Création de la table "stat"
CREATE TABLE IF NOT EXISTS stat (
    stat_id INT AUTO_INCREMENT PRIMARY KEY,
    animal_id INT,
    counter INT,
    date DATE,
    FOREIGN KEY (animal_id) REFERENCES animal(animal_id)
);

-- Création de la table "utilisateur"
CREATE TABLE IF NOT EXISTS utilisateur (
    username VARCHAR(255) PRIMARY KEY,
    nom VARCHAR(255),
    password VARCHAR(255),
    prenom VARCHAR(255),
    role_id INT,
    FOREIGN KEY (role_id) REFERENCES role(role_id)
);

