-- Intégration des données dans la table "habitat"
INSERT INTO zarca_bdd.habitat (image_id, commentaire_habitat, description, nom) VALUES 
(1, 'L''habitat de la savane est bien aménagé, offrant des espaces ouverts et des abris appropriés pour les animaux. La végétation est bien entretenue, fournissant une atmosphère naturelle qui favorise le comportement naturel des espèces qui y habitent. Les points d''eau sont adéquats pour les besoins en hydratation des animaux, ce qui contribue à leur bien-être général.', 'La savane est un paysage caractérisé par de vastes plaines herbeuses parsemées d''arbres dispersés, principalement trouvée dans les régions tropicales et subtropicales. Les températures sont généralement chaudes, avec des saisons sèches et humides distinctes. La savane abrite une diversité d''animaux, y compris des herbivores comme les zèbres et les girafes, ainsi que des prédateurs tels que les lions et les léopards.', 'Savane'),
(2, 'L''habitat de la jungle est dense et luxuriant, recréant efficacement l''environnement naturel des animaux de la jungle. La végétation offre de nombreuses cachettes et structures pour permettre aux animaux de se cacher, grimper et explorer. Les conditions d''humidité sont bien contrôlées pour imiter au mieux le climat de la jungle, favorisant ainsi le comportement naturel des espèces qui y résident.', 'La jungle est une forêt dense et luxuriante, souvent trouvée dans les climats tropicaux et équatoriaux, caractérisée par une végétation dense, des arbres immenses et une humidité élevée. Les canopées des arbres créent un environnement sombre et ombragé en dessous, où une multitude d''espèces végétales et animales prospèrent. Les singes, les oiseaux tropicaux colorés et une variété d''insectes sont des habitants communs de la jungle.', 'Jungle'),
(3, 'L''habitat du marais est soigneusement conçu pour refléter les caractéristiques naturelles d''un marais, avec des zones aquatiques et terrestres appropriées. La végétation aquatique est bien entretenue, offrant des refuges et des habitats pour une variété d''espèces, des oiseaux aquatiques aux reptiles. Les conditions de l''eau sont surveillées de près pour assurer une qualité adéquate, soutenant ainsi la santé et le bien-être des animaux qui y vivent.', 'Les marais sont des zones humides caractérisées par une végétation aquatique dense, des eaux stagnantes ou peu profondes, et une variété d''espèces animales adaptées à ce milieu particulier. Les marais peuvent varier en taille et en complexité, allant des petits marais côtiers aux vastes zones de marécages intérieurs. Ils abritent souvent des oiseaux aquatiques, des reptiles comme les crocodiles et les alligators, ainsi que divers amphibiens et poissons adaptés à la vie dans l''eau stagnante.', 'Marais');

